import React, { Component, useState } from 'react';
import './App.css'
import '@fortawesome/fontawesome-free/css/all.min.css';
import {RenderApp} from './Components/RenderApp/index'




function App() {
  const [tasks, setTasks] = useState([]);
  const [inputValue, setInputValue] = useState('');

  function handleChange(event) {
    setInputValue(event.target.value);

  }

  function handleDelete(index) {
    console.log("Delete Button");
  }

  function handleEdit(index) {
    console.log("Edit Button");
  }

  function handleKeyPress(event) {
    if (event.key === 'Enter') {
      setTasks((prevValues) => [...prevValues, inputValue.trim()]);
      setInputValue('');
    }
  }





  return (
    <RenderApp tasks={tasks} inputValue={inputValue} handleChange={handleChange} handleKeyPress={handleKeyPress} handleDelete={handleDelete} handleEdit= {handleEdit} />


  );

}

export default App;
